def is_nested(string):
    opening_brackets = []
    nested_found = False

    for char in string:
        if char == '[':
            opening_brackets.append(char)
        elif char == ']':
            if opening_brackets:
                opening_brackets.pop()
                if len(opening_brackets) < len(string) - string.index(char):
                    nested_found = True

    return nested_found

